import { StyleSheet, Text, View } from 'react-native'
import React from 'react'
import MainHeader from '../Components/MainHeader';
import { TouchableOpacity } from 'react-native-web';
import footballBackground from '../assets/footballBackground.png'
import tennisBackground from '../assets/tennisBackground.png'
import basketballBackground from '../assets/basketballBackground.png'


export default function Home() {
  return (
    <View style={styles.title}>
      <MainHeader title={"Choose Your Booking Club"} />
      <View style={styles.football}>
        <TouchableOpacity>
          <Image source={footballBackground} style={footballStyle}/>
        </TouchableOpacity>
      </View>
      <View style={styles.tennis}>
      <TouchableOpacity>
          <Image source={tennisBackground} style={tennisBackground}/>
        </TouchableOpacity>
      </View>
      <View style={styles.basketball}></View>
      <TouchableOpacity>
          <Image source={basketballBackground} style={basketballBackground}/>
        </TouchableOpacity>
    </View>

  );
}

